// Get HTML and CSS separately for display
export const getLoaderCodeParts = (id: string, html: string): { html: string; css: string } => {
    const css = loaderCSS[id] || `/* CSS for loader-${id} not found */`;
    return { html, css };
};

// Markdown template for copying
export const getLoaderFullCode = (id: string, name: string, html: string): string => {
    const css = loaderCSS[id] || `/* CSS for loader-${id} not found */`;
    return `# ${name} Loader (#${id})

## HTML

\`\`\`html
${html}
\`\`\`

## CSS

\`\`\`css
${css}
\`\`\`

---
>  Copy both HTML and CSS to your project.
`;
};
